import classes from './Sections.module.css';

const Sections = () => {
    return (
        <>
            <div
                className={classes.tiles}
                style={{ backgroundImage: `url(${technologyImgUrl})` }}>
                <h3>Technology</h3>
            </div>
            <div
                className={classes.tiles}
                style={{ backgroundImage: `url(${psychologyImgUrl})` }}>
                <h3>Psychology</h3>
            </div>
            <div
                className={classes.tiles}
                style={{ backgroundImage: `url(${imageUrl})` }}>
                <h3>Books</h3>
            </div>
            <div
                className={classes.tiles}
                style={{ backgroundImage: `url(${imageUrl})` }}>
                <h3>Philosophy</h3>
            </div>
            <div
                className={classes.tiles}
                style={{ backgroundImage: `url(${imageUrl})` }}>
                <h3>Food</h3>
            </div>
            <div
                className={classes.tiles}
                style={{ backgroundImage: `url(${imageUrl})` }}>
                <h3>Health</h3>
            </div>

        </>
    );
}

export default Sections;
